export const Container = styled.div`
  flex-direction: column;
  padding: 16px;
  background-color: ${({ theme }) => theme.colors.SecundaryBackgroundColor};
  border-radius: 16px;
`;

export const Title = styled.div`
    font-size: 16px;
`
